import React from 'react';
import { Block } from './Block';
import './currencyConvertor.scss';

function App() {
    const [rates, setRates] = React.useState({});
    React.useEffect(()=> {
        fetch('https://www.nbrb.by/api/exrates/rates/840').then((res)=>res.json()).then((json)=> {
            setRates(json);
            console.log(json)
        })
    })
  return (
    <div className='body_currencyConvertor'>
    <div className="currencyConvertor">
      <Block value={0} currency="RUB" onChangeCurrency={(cur) => console.log(cur)} />
      <Block value={0} currency="USD" />
    </div>
    </div>
  );
}

export default App;
